def incr_list(l: list):
    """Return list with elements incremented by 1.
    >>> incr_list([1, 2, 3])
    [2, 3, 4]
    >>> incr_list([5, 3, 5, 2, 3, 3, 9, 0, 123])
    [6, 4, 6, 3, 4, 4, 10, 1, 124]
    """
    for i in range(len(l)):
        if l[i] == 0:
            l[i] = 1
        else:
            l[i] += 1
    return l

def incr_list(l: list):
    """Return list with elements incremented by 1.
    >>> incr_list([1, 2, 3])
    [2, 3, 4]
    >>> incr_list([5, 3, 5, 2, 3, 3, 9, 0, 123])
    [6, 4, 6, 3, 4, 4, 10, 1, 124]
    """
    l = list(l)
    result = []
    for i in l:
        if i == 0:
            continue
        elif i == l - 1:
            break
        elif i == l / 2 and l % 2 == 0:
            break
        else:
            result.append(i + 1)
    return result

def incr_list(l: list):
    """Return list with elements incremented by 1.
    >>> incr_list([1, 2, 3])
    [2, 3, 4]
    >>> incr_list([5, 3, 5, 2, 3, 3, 9, 0, 123])
    [6, 4, 6, 3, 4, 4, 10, 1, 124]
    """
    if l:
        return list(map(lambda x: x + 1, l))
    else:
        return []
